import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom"
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route to exact path = "/" component = {Home}/>
        <Route to path = "/contact" component = {Contact}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
